import{_ as i,X as e,Y as a,a2 as l}from"./framework-a20dc394.js";const r="/assets/img_10-f29c763b.png",o={},t=l('<h1 id="github学习" tabindex="-1"><a class="header-anchor" href="#github学习" aria-hidden="true">#</a> Github学习</h1><p>使用Github优秀框架 + 源码 提升自己</p><h2 id="常用词含义" tabindex="-1"><a class="header-anchor" href="#常用词含义" aria-hidden="true">#</a> 常用词含义</h2><ul><li>watch：会持续收到该项目的动态</li><li>fork：复制某个仓库到自己的Github仓库中</li><li>star：可以理解为点赞</li><li>clone：将项目下载至本地</li><li>follow：关注你感兴趣的作者，会收到他们的动态</li></ul><h2 id="in关键字限制搜索范围" tabindex="-1"><a class="header-anchor" href="#in关键字限制搜索范围" aria-hidden="true">#</a> in关键字限制搜索范围</h2><ul><li>公式：<code>XXX关键字 in:name 或 description 或 readme</code></li><li>xxx in:name 项目名称含有XXX的</li><li>xxx in:description 项目描述含有XXX的</li><li>xxx in:readme 项目的readme文件中包含XXX的</li><li>组合使用 <ul><li>xxx in:name,readme 项目的名称和readme中包含xxx的</li></ul></li></ul><h2 id="stars或fork数量关键字查找" tabindex="-1"><a class="header-anchor" href="#stars或fork数量关键字查找" aria-hidden="true">#</a> stars或fork数量关键字查找</h2><ul><li>公式： <ul><li><code>xxx关键字 stars 通配符</code> :&gt; 或者 :&gt;=</li><li>区间范围数字： <code>stars:数字1..数字2</code></li></ul></li><li>案例 <ul><li>查找stars数大于等于5000的Springboot项目：springboot stars:&gt;=5000</li><li>查找forks数在1000~2000之间的springboot项目：springboot forks:1000..5000</li></ul></li><li>组合使用 <ul><li>查找star大于1000，fork数在500到1000：<code>springboot stars:&gt;1000 forks:500..1000</code></li></ul></li></ul><h2 id="awesome加强搜索" tabindex="-1"><a class="header-anchor" href="#awesome加强搜索" aria-hidden="true">#</a> awesome加强搜索</h2><ul><li>公式：<code>awesome 关键字</code>：awesome系列，一般用来收集学习、工具、书籍类相关的项目</li><li>搜索优秀的redis相关的项目，包括框架，教程等 awesome redis</li></ul><h2 id="高亮显示某行代码" tabindex="-1"><a class="header-anchor" href="#高亮显示某行代码" aria-hidden="true">#</a> 高亮显示某行代码</h2><ul><li>一行：地址后面紧跟 #L10 <ul><li><code>https://github.com/XXX#L13</code></li></ul></li><li>多行：地址后面紧跟 #Lx - #Ln <ul><li><code>https://github.com/XXX#L13-L30</code></li></ul></li></ul><h2 id="项目内搜索" tabindex="-1"><a class="header-anchor" href="#项目内搜索" aria-hidden="true">#</a> 项目内搜索</h2><ul><li>使用英文字母 <code>t</code> ,开启项目内搜索</li></ul><p><img src="'+r+'" alt="img_10.png"></p><h2 id="搜索某个地区内的大佬" tabindex="-1"><a class="header-anchor" href="#搜索某个地区内的大佬" aria-hidden="true">#</a> 搜索某个地区内的大佬</h2><ul><li>location：地区</li><li>language：语言</li><li>例如：<code>location:beijing language:java</code></li></ul>',17),d=[t];function s(h,n){return e(),a("div",null,d)}const u=i(o,[["render",s],["__file","Github学习.html.vue"]]);export{u as default};
